英国式カラーセラピー【オーラソーマ/Aura Soma 製品】<BR><BR>25ml<BR><BR>すべてのチャクラを保護し、バランスをとらせる能力があります。特にネガティブなエネルギーや余計な波動を取り去るのに適していますので使用者自身の浄化や物質の浄化に最適なエッセンスです。<BR><BR>オーラに対して保護の膜を張り、強力にあなたをネガティブエネルギーから守りながら、色の力を取り入れることが出来ます。<BR><BR>ポマンダーは49種類のハーブの抽出液とエッセンシャルオイル、品質保存のためのアルコールからなります。それぞれに天然石のエネルギーが転写されています。もとは部屋の浄化や雰囲気作りに使われていました。肉体を取り巻いている電磁場に作用しネガティブな物を浄化していき、また、ポマンダーの持つカラーやハーブの力を取り入れ、電磁場を保護することが出来ます。部屋の場の雰囲気を変える効果もあり、仕事などのストレス解消や、うまくいかない対人関係の緩和、受け入れたくない悪い雰囲気などのシャットアウトにも使用できます。治療や、精神的、あるいは創造的な仕事にたずさわる方にもお薦め。効果時間は約2時間<BR><BR>※自社サイトとの共有在庫のため、ご注文のタイミングによっては商品をご用意できない場合がございます。<STYLE type="text/css">
<!--
