background-repeat:repeat-y;
background-position: right;
}
-->
</STYLE>

英国式カラーセラピー【オーラソーマ/Aura Soma 製品】<BR><BR>25ml<BR><BR>水晶のエネルギーが含まれています。浄化を通じて目的とヴィジョンの明晰性をもたらします。部屋や貴石、あるいは基本的にすべての存在物を取りまくオーラを、エネルギー的に浄化する完璧なエッセンスです。バランスを取り戻して、磁場を閉じ、保護し、ポジティブな物が寄って来やすくなるようにします。また、石と自分とに施すと、天然石の持つメッセージや贈り物に通じやすくなり同調するよう支援してくれます。ポマンダーを使って浄化してからクイントエッセンスで本来の働きを呼び起こすと良いでしょう。<BR><BR>あなたが今の自分の使命をまっとうできるよう、精妙なエネルギーで見守ってくれます。その色に関係したあなた本来が持つエネルギーをしっかりと引き出し、自分の個性や真理を開花させてくれます。<BR><BR>クイントエッセンスは49種類のハーブの抽出液とエッセンシャルオイル、品質保存のためのアルコールからなります。それぞれに天然石のエネルギーが転写されています。私たちが自分の今の使命を果たすことが出来るよう支援してくれる。肉体から30cmほど離れた部位（アストラル体とエーテル体）に作用し、非常に精妙なエネルギーを持っていて、その光線の非常にポジティブなエネルギーをオーラの領域に呼び起こす。それらはマスターボトルと呼ばれるボトルに関連しています。クイントエッセンスには、容易に瞑想の状態に導き、最高の体験をもたらしてくれる効果がある。また、部屋や家の空気の浄化やコンディショニング、鎮静やひらめき、芸術性、治癒の補助などにも良い。<BR><BR>※自社サイトとの共有在庫のため、ご注文のタイミングによっては商品をご用意できない場合がございます。<STYLE type="text/css">
